import React from "react";
import { GoogleMap,LoadScript } from '@react-google-maps/api';
function Map(){
    const style = {
        width : '1500px',
        height : '400px'
    };
    const center = {
        lat : -3.745,
        lng : -38.523
    };

    return (
        <div className="map">
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={style}
                    center={center}
                    zoom={10}
                >
                </GoogleMap>
            </LoadScript>
        </div>
    );
}

export default Map;
